import React, { Component } from "react";
import Navbar from "../components/Navbar.js";
import Footer from "../components/Footer.js";

export default class Register extends Component {
  overskrift = "";
  innhold = "";
  bilde = "";
  kategori_id = 0;
  viktighet = 0;
  render() {
    return (
      <div>
        <Navbar />
        <div class="jumbotron jumbotron-fluid">
          <div class="container">
            <h1 class="display-4">Registrer en sak!</h1>
            <p class="lead">
              Her kan du laste opp en nyhetssak til vår nettside.
            </p>
          </div>
        </div>
        <form onsubmit="submit()">
          <div class="form-group mx-5">
            <label>Tittel</label>
            <input
              type="text"
              value={this.overskrift}
              onChange={(event: SyntheticInputEvent<HTMLInputElement>) =>
                (this.overskrift = event.target.value)
              }
              class="form-control"
              placeholder="Skriv inn tittelen til din sak"
            ></input>
          </div>
          <div class="form-group mx-5">
            <label for="exampleInputPassword1">Beskrivelse</label>
            <textarea
              type="text"
              class="form-control"
              value={this.innhold}
              onChange={(event: SyntheticInputEvent<HTMLInputElement>) =>
                (this.innhold = event.target.value)
              }
              placeholder="Skriv inn det innholdet du ønsker vist i saken"
              rows="5"
            ></textarea>
          </div>
          <div class="form-group mx-5">
            <label>Bilde-URL</label>
            <input
              type="text"
              value={this.bilde}
              onChange={(event: SyntheticInputEvent<HTMLInputElement>) =>
                (this.bilde = event.target.value)
              }
              class="form-control"
              placeholder="Skriv inn bilde-URL til din sak"
            ></input>
          </div>
          <div class="form-group mx-5">
            <label>Kategori</label>
            <input
              type="number"
              value={this.kategori_id}
              onChange={(event: SyntheticInputEvent<HTMLInputElement>) =>
                (this.kategori_id = event.target.value)
              }
              class="form-control"
              placeholder="Skriv inn tittelen til din sak"
            ></input>
          </div>
          <div class="form-group mx-5">
            <label>Viktighet</label>
            <input
              type="number"
              value={this.viktighet}
              onChange={(event: SyntheticInputEvent<HTMLInputElement>) =>
                (this.viktighet = event.target.value)
              }
              class="form-control"
              placeholder="Skriv inn tittelen til din sak"
            ></input>
          </div>

          <button type="submit" class="btn btn-primary mx-5">
            Submit
          </button>
        </form>
        <Footer />
      </div>
    );
  }
}

